p; (OR)&nbsp; <a href="https://www.rediffmail.com/cgi-bin/red.cgi?red=http%3A%2F%2Fwww%2Eantiragging%2Ein&amp;isImage=0&amp;BlockImage=0&amp;rediffng=0&amp;rogue=c94e7d498d8910980b397dfa444ef05586b91843&amp;rdf=ACYHZAJrBGtTZ1NlUV1XYFtgXzoNIlgp&amp;els=17a9c725ba69b6704caa801b07df3018" target="_blank"><span style="mso-bidi-font-size: 11.0pt; color: windowtext;">www.antiragging.in</span></a></span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 14.0pt; font-family: ''Centaur'',''serif''; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: EN-IN;">All the students are asked to fill their Undertaking on any of the two web sites. The procedure is very simple and explained on the web sites</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span style="font-size: 14.0pt; font-family: ''Centaur'',''serif''; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: EN-IN;"><br /> They must Record the following Helplines and Email addresses</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span style="font-size: 14.0pt; font-family: ''Centaur'',''serif''; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: EN-IN;">Anti-ragging Helpline :1800-180-5522 <br /> <a href="https://f1mail.rediff.com/ajaxprism/writemail?mode=mail_to_individual&amp;email=collegedesk.antiragging@gmail.com&amp;filename=1490950435.S.4640.Z.5531.H.TkFudGktUmFnZ2luZyBIZWxwbGluZQBPbmxpbmUgVW5kZXJ0YWtpbmc_.RU.rfs334,rfs334,934,5.f4-234-222&amp;folder=Inbox&amp;els=17a9c725ba69b6704caa801b07df3018"><span style="mso-bidi-font-size: 11.0pt; color: windowtext;">collegedesk.antiragging@gmail.com</span></a> </span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>', '2017-03-31'),
