(96, 'Part I Hons Admit Card', '<p>Admit Card for BA BSc Pt I Hons 2017 will be available from 19.7.17 from the Aministrative office of first floor at 6.00 pm.</p>', '2017-07-18'),
(97, 'Part I Gen Admit Card', '<p>Admit Card for BA BSc Part I Gen 2017 will be available from 22.7.17 from the Aministrative office of first floor at 6.00 pm.</p>', '2017-07-20');
