	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal">Students are asked to collect <span style="font-size: 8.0pt; line-height: 115%; font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: EN-IN;">ONLINE COMPETITIVE EXAMINATION PORTAL form from Sm Romi Mukherjee of the 1<sup>st</sup> Floor administrative office for preparation of Entry in Service by competitive examinations like SSC, LIC, Bank, Rail, PSC etc, which will be arranged by the college itself free of cost. Students may also collect and print the form from Internet by clicking &ldquo;Exam Form&rdquo; button in the webpage. Duly filled up forms must be submitted to Sm Mukherjee within 16.8.17. They may prepare themselves for competitive examinations at home through the college webpage after obtaining user ID and Password, which will be provided by the college in due course. </span></p>', '2017-08-08'),
(100, 'Starting of Third Year Classes', '<p>Classes for 3rd Year BA, BSc, BCom (Hons and Gen) will start from 21.8.17 (Monday)</p>', '2017-08-17'),
(101, 'First Year University Registration Form Fill Up', '<p>First Year BA BSc BCom (Hons &amp; Gen) students those who have not yet filled up theirUniversity&nbsp; Registration Form&nbsp; must do the same within 24th August 2017. They should bring their Original and Xerox Madhyamik and Higher Secondary Mark Sheet&nbsp; and Admit Card, SC/ST/OBC Certificare (if any), College Fees Book and Challans, two stamp size colored photo, Adhar Card and Contact Sri Ujjal Banerjee (Phone 9830122617) of the First Floor Administrative office.</p>', '2017-08-18'),
(103, 'Seat Booking (2nd Year)', '<p>All the provisional second year students of BA/BSc/BCom (Hons and Gen) who have appeared in Part I Exam 2017 are hereby instructed to deposit Rs 700/- through challan (Offline) or through Card (Online) by clicking the &lsquo;pay admission fees online&rsquo; button at the top of this webpage for getting their Roll Numbers and Fees books positively within 15 days from this notification.</p>', '2017-08-22'),
(107, 'Holiday', '<p>The College will remain closed on 2nd September 2017 account of Id-uz Zoha.</p>', '2017-08-26'),
(108, 'Starting of SecondYear Classes', '<p>&nbsp;</p>\r\n<p>Classes for 2nd Year BA, BSc, BCom (Hons and Gen) will start from 29.8.17 (Tuesday)</p>', '2017-08-26');
