INSERT INTO `stat_body` (`id`, `name`, `description`) VALUES
(2, 'Governing Body', '<p>Governing Body of government aided colleges like this college is comprised of the following members. Tenure of the G.B. is of four years.</p>\r\n<ol>\r\n<li>President, to be elected by the member of the G.B. President may be any member of G.B. or may not be. But once elected, he/ she continues to be a member.&nbsp;</li>\r\n<li>Two members to be nominated by the university. Therefore they are called University Nominee.</li>\r\n<li>To members to be nominated by the Government. Therefore they are called Government Nominee.</li>\r\n<li>Four members to be elected by the fulltime teaching staff (Including Librarian and Graduate Laboratory Instructors). Therefore they are called Teachers Nominee.</li>\r\n<li>Two members to be elected by the fulltime non-teaching staff of the college. Therefore they are called Non-teaching Nominee.</li>\r\n<li>One member to be elected from Students Union. Generally General Secretory of students union is elected as member of the G.B.</li>\r\n<li>Local Councilor in which area college is situated is a member of the G.B. by virtue of his/her position.</li>\r\n<li>Principal is also a member of the G.B. as well as Secretory, G.B. (exofficio).</li>\r\n</ol>\r\n<p><strong>Functions of G.B.:&nbsp;</strong></p>\r\n<ol>\r\n<li>G.B. is responsible for overall administration of the college.</li>\r\n<li>G.B. takes policy decision on major Academic and administative matter.</li>\r\n<li><span style="font-family: Verdana, sans-serif; font-size: 8.5pt; text-indent: -18pt;">To cooperate the principal so that he can perform day to day administration smoothly.</span></li>\r\n<li><span style="font-family: Verdana, sans-serif; font-size: 8.5pt; text-indent: -18pt;">G.B. is the appointing autherity for Principal, who is under the recommendation of College Service Commission.</span></li>\r\n<li><span style="font-family: Verdana, sans-serif; font-size: 8.5pt; text-indent: -18pt;">G.B. is the directive body who directs the principal to appoint teaching and non-teaching staff of the college.</span></li>\r\n<li><span style="font-family: Verdana, sans-serif; font-size: 8.5pt; text-indent: -18pt;">G.B. forms the&nbsp;</span>Finance subcommittee and Academic subcommittee .</li>\r\n</ol>\r\n<p><span style="font-family: Verdana, sans-serif;"><span style="font-size: 11.3333330154419px;">&nbsp;</span></span></p>');

